import './App.css';
import { BrowserRouter , Route , Router } from 'react-router-dom';
import Home from './component/Home'
function App() {
  return (
    <div className="App">
      <h1>Hello</h1>
      <BrowserRouter>
      <Router>
        <Route path="/" exact component={Home} />
      </Router>
      </BrowserRouter>
    </div>
  );
}

export default App;
